class Solution {
    /**
     * Insert a number 'delimiter' between every two consecutive elements of input list `numbers'.
     * 
     * @param numbers The input list of integers.
     * @param delimiter The integer to be inserted between consecutive elements.
     * @return A new list with the delimiter inserted between consecutive elements.
     */
    public List<Integer> intersperse(List<Integer> numbers, int delimiter) {
        // Step 1: Check for empty input list
        if (numbers.isEmpty()) {
            return new ArrayList<>();
        }

        // Step 2: Initialize the result list
        List<Integer> result = new ArrayList<>();

        // Step 3: Iterate through the input list
        for (int i = 0; i < numbers.size(); i++) {
            // Add the current element to the result list
            result.add(numbers.get(i));

            // Add the delimiter if the current element is not the last one
            if (i < numbers.size() - 1) {
                result.add(delimiter);
            }
        }

        // Step 4: Return the result list
        return result;
    }

    // Main method for testing
    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.intersperse(List.of(), 4)); // Output: []
        System.out.println(solution.intersperse(Arrays.asList(1, 2, 3), 4)); // Output: [1, 4, 2, 4, 3]
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.intersperse(new ArrayList<>(List.of()), 7).equals(List.of()),
                s.intersperse(new ArrayList<>(Arrays.asList(5, 6, 3, 2)), 8).equals(Arrays.asList(5, 8, 6, 8, 3, 8, 2)),
                s.intersperse(new ArrayList<>(Arrays.asList(2, 2, 2)), 2).equals(Arrays.asList(2, 2, 2, 2, 2))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

