class Solution {
    /**
    From a given list of integers, generate a list of rolling maximum element found until given moment
    in the sequence.
    >>> rolling_max(Arrays.asList(1, 2, 3, 2, 3, 4, 2))
    [1, 2, 3, 3, 3, 4, 4]
     */
    public List<Integer> rolling_max(List<Integer> numbers) {
        // Input Validation
        if (numbers == null || numbers.isEmpty()) {
            return new ArrayList<>();
        }

        // Initialization
        int currentMax = numbers.get(0);
        List<Integer> rollingMaxList = new ArrayList<>();
        rollingMaxList.add(currentMax);

        // Processing the List
        for (int i = 1; i < numbers.size(); i++) {
            int num = numbers.get(i);
            if (num > currentMax) {
                currentMax = num;
            }
            rollingMaxList.add(currentMax);
        }

        // Output
        return rollingMaxList;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.rolling_max(new ArrayList<>(List.of())).equals(List.of()),
                s.rolling_max(new ArrayList<>(Arrays.asList(1, 2, 3, 4))).equals(Arrays.asList(1, 2, 3, 4)),
                s.rolling_max(new ArrayList<>(Arrays.asList(4, 3, 2, 1))).equals(Arrays.asList(4, 4, 4, 4)),
                s.rolling_max(new ArrayList<>(Arrays.asList(3, 2, 3, 100, 3))).equals(Arrays.asList(3, 3, 3, 100, 100))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

