class Solution {
    /**
    Input are two strings a and b consisting only of 1s and 0s.
    Perform binary XOR on these inputs and return result also as a string.
    >>> string_xor("010", "110")
    "100"
     */
    public String string_xor(String a, String b) {
        // Step 1: Validate input strings
        if (!isValidBinaryString(a) || !isValidBinaryString(b)) {
            throw new IllegalArgumentException("Input strings must contain only 1s and 0s.");
        }

        // Step 2: Ensure both strings are of equal length
        a = padString(a, b.length());
        b = padString(b, a.length());

        // Step 3: Perform binary XOR
        StringBuilder result = new StringBuilder();
        for (int i = 0; i < a.length(); i++) {
            char charA = a.charAt(i);
            char charB = b.charAt(i);
            if (charA == charB) {
                result.append('0');
            } else {
                result.append('1');
            }
        }

        // Step 4: Return the result
        return result.toString();
    }

    private boolean isValidBinaryString(String s) {
        for (char c : s.toCharArray()) {
            if (c != '0' && c != '1') {
                return false;
            }
        }
        return true;
    }

    private String padString(String s, int length) {
        while (s.length() < length) {
            s = "0" + s;
        }
        return s;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.string_xor("111000", "101010"), "010010"),
                Objects.equals(s.string_xor("1", "1"), "0"),
                Objects.equals(s.string_xor("0101", "0000"), "0101")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

