class Solution {
    /**
     * Filter an input list of strings only for ones that contain given substring
     * 
     * @param strings the list of strings to filter
     * @param substring the substring to filter by
     * @return a new list containing only the strings that contain the specified substring
     */
    public List<String> filter_by_substring(List<String> strings, String substring) {
        if (strings == null || strings.isEmpty()) {
            return Collections.emptyList();
        }
        if (substring == null || substring.isEmpty()) {
            return new ArrayList<>(strings);
        }

        List<String> filteredStrings = new ArrayList<>();
        for (String str : strings) {
            if (str.contains(substring)) {
                filteredStrings.add(str);
            }
        }

        return filteredStrings;
    }

    // Test cases
    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.filter_by_substring(List.of(), "a")); // []
        System.out.println(solution.filter_by_substring(Arrays.asList("abc", "bacd", "cde", "array"), "a")); // [abc, bacd, array]
    }
}

