class Solution {
    /**
    Input to this function is a string containing multiple groups of nested parentheses. Your goal is to
    separate those group into separate strings and return the list of those.
    Separate groups are balanced (each open brace is properly closed) and not nested within each other
    Ignore any spaces in the input string.
    >>> separate_paren_groups("( ) (( )) (( )( ))")
    ["()", "(())", "(()())"]
     */
    public List<String> separate_paren_groups(String paren_string) {
        // Step 1: Remove spaces from the input string
        String noSpaceString = removeSpaces(paren_string);

        // Step 2: Initialize variables
        List<String> result = new ArrayList<>();
        Stack<Character> stack = new Stack<>();
        StringBuilder currentGroup = new StringBuilder();

        // Step 3: Traverse the string to identify and separate groups
        for (char c : noSpaceString.toCharArray()) {
            if (c == '(') {
                stack.push(c);
                currentGroup.append(c);
            } else if (c == ')') {
                stack.pop();
                currentGroup.append(c);
                if (stack.isEmpty()) {
                    result.add(currentGroup.toString());
                    currentGroup.setLength(0); // Reset for the next group
                }
            }
        }

        // Step 4: Return the list of separated groups
        return result;
    }

    // Helper method to remove spaces from the input string
    private String removeSpaces(String input) {
        return input.replaceAll(" ", "");
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.separate_paren_groups("(()()) ((())) () ((())()())").equals(Arrays.asList(
                        "(()())", "((()))", "()", "((())()())"
                )),
                s.separate_paren_groups("() (()) ((())) (((())))").equals(Arrays.asList(
                        "()", "(())", "((()))", "(((())))"
                )),
                s.separate_paren_groups("(()(())((())))").equals(Arrays.asList(
                        "(()(())((())))"
                )),
                s.separate_paren_groups("( ) (( )) (( )( ))").equals(Arrays.asList("()", "(())", "(()())"))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

