class Solution {
    /**
    Find how many times a given substring can be found in the original string. Count overlapping cases.
    >>> how_many_times("", "a")
    0
    >>> how_many_times("aaa", "a")
    3
    >>> how_many_times("aaaa", "aa")
    3
     */
    public int how_many_times(String string, String substring) {
        // Input validation
        if (string == null || substring == null) {
            throw new IllegalArgumentException("Input string and substring cannot be null");
        }
        if (substring.isEmpty()) {
            return 0;
        }

        // Initialize variables
        int count = 0;
        int stringLength = string.length();
        int substringLength = substring.length();

        // Sliding window search
        for (int i = 0; i <= stringLength - substringLength; i++) {
            if (string.substring(i, i + substringLength).equals(substring)) {
                count++;
            }
        }

        // Return the result
        return count;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.how_many_times("", "x") == 0,
                s.how_many_times("xyxyxyx", "x") == 4,
                s.how_many_times("cacacacac", "cac") == 4,
                s.how_many_times("john doe", "john") == 1
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

