class Solution {
    // Static map to associate numerals with their integer values
    private static final Map<String, Integer> NUMERAL_MAP = new HashMap<>();
    static {
        NUMERAL_MAP.put("zero", 0);
        NUMERAL_MAP.put("one", 1);
        NUMERAL_MAP.put("two", 2);
        NUMERAL_MAP.put("three", 3);
        NUMERAL_MAP.put("four", 4);
        NUMERAL_MAP.put("five", 5);
        NUMERAL_MAP.put("six", 6);
        NUMERAL_MAP.put("seven", 7);
        NUMERAL_MAP.put("eight", 8);
        NUMERAL_MAP.put("nine", 9);
    }

    public String sort_numbers(String numbers) {
        // Step 1: Parse the input string
        String[] numberals = numbers.split(" ");

        // Step 2: Convert numberals to digits
        int[] digits = new int[numberals.length];
        for (int i = 0; i < numberals.length; i++) {
            digits[i] = NUMERAL_MAP.get(numberals[i]);
        }

        // Step 3: Sort the digits
        Arrays.sort(digits);

        // Step 4: Convert digits back to numberals
        String[] sortedNumberals = new String[digits.length];
        for (int i = 0; i < digits.length; i++) {
            for (Map.Entry<String, Integer> entry : NUMERAL_MAP.entrySet()) {
                if (entry.getValue() == digits[i]) {
                    sortedNumberals[i] = entry.getKey();
                    break;
                }
            }
        }

        // Step 5: Construct the output string
        return String.join(" ", sortedNumberals);
    }
}

