class Solution {
    /**
     * Flips the case of each character in the given string.
     * Uppercase characters are converted to lowercase and vice versa.
     * Non-alphabetic characters remain unchanged.
     *
     * @param string The input string to be processed.
     * @return A new string with flipped case characters.
     */
    public String flip_case(String string) {
        if (string == null) {
            return null;
        }

        StringBuilder result = new StringBuilder();
        for (char c : string.toCharArray()) {
            if (Character.isUpperCase(c)) {
                result.append(Character.toLowerCase(c));
            } else if (Character.isLowerCase(c)) {
                result.append(Character.toUpperCase(c));
            } else {
                result.append(c);
            }
        }

        return result.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.flip_case("Hello")); // Output: hELLO
    }
}

