class Solution {
    /**
     * Given list of numbers (of at least two elements), apply a linear transform to that list,
     * such that the smallest number will become 0 and the largest will become 1.
     *
     * @param numbers List of double values.
     * @return List of transformed double values.
     */
    public List<Double> rescale_to_unit(List<Double> numbers) {
        if (numbers == null || numbers.size() < 2) {
            throw new IllegalArgumentException("List must contain at least two elements.");
        }

        double min = Collections.min(numbers);
        double max = Collections.max(numbers);
        double range = max - min;

        List<Double> transformedList = new ArrayList<>();
        for (double num : numbers) {
            double transformedValue = (num - min) / range;
            transformedList.add(transformedValue);
        }

        return transformedList;
    }
}

