class Solution {
    /**
    This function takes a list l and returns a list l' such that
    l' is identical to l in the odd indicies, while its values at the even indicies are equal
    to the values of the even indicies of l, but sorted.
    >>> sort_even(Arrays.asList(1, 2, 3))
    [1, 2, 3]
    >>> sort_even(Arrays.asList(5, 6, 3, 4))
    [3, 6, 5, 4]
     */
    public List<Integer> sort_even(List<Integer> l) {
        // Step 1: Initialize variables
        List<Integer> evenIndicesElements = new ArrayList<>();
        List<Integer> result = new ArrayList<>();

        // Step 2: Extract even indices elements
        for (int i = 0; i < l.size(); i += 2) {
            evenIndicesElements.add(l.get(i));
        }

        // Step 3: Sort even indices elements
        Collections.sort(evenIndicesElements);

        // Step 4: Reconstruct the list
        int evenIndex = 0;
        for (int i = 0; i < l.size(); i++) {
            if (i % 2 == 0) {
                result.add(evenIndicesElements.get(evenIndex++));
            } else {
                result.add(l.get(i));
            }
        }

        // Step 5: Return the result
        return result;
    }
}

