class Solution {
    /**
    This function takes a list l and returns a list l' such that
    l' is identical to l in the indicies that are not divisible by three, while its values at the indicies that are divisible by three are equal
    to the values of the corresponding indicies of l, but sorted in ascending order.
    >>> sort_third(Arrays.asList(1, 2, 3))
    [1, 2, 3]
    >>> sort_third(Arrays.asList(5, 6, 3, 4, 8, 9, 2))
    [2, 6, 3, 4, 8, 9, 5]
     */
    public List<Integer> sort_third(List<Integer> l) {
        // Step 1: Initialize the result list
        List<Integer> result = new ArrayList<>(l);

        // Step 2: Identify and extract elements at indices divisible by 3
        List<Integer> indicesToSort = new ArrayList<>();
        List<Integer> elementsToSort = new ArrayList<>();

        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                indicesToSort.add(i);
                elementsToSort.add(l.get(i));
            }
        }

        // Step 3: Sort the extracted elements
        Collections.sort(elementsToSort);

        // Step 4: Replace elements in the result list
        for (int i = 0; i < indicesToSort.size(); i++) {
            result.set(indicesToSort.get(i), elementsToSort.get(i));
        }

        // Step 5: Return the result list
        return result;
    }
}

