    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.prime_fib(1) == 2,
                s.prime_fib(2) == 3,
                s.prime_fib(3) == 5,
                s.prime_fib(4) == 13,
                s.prime_fib(5) == 89,
                s.prime_fib(6) == 233,
                s.prime_fib(7) == 1597,
                s.prime_fib(8) == 28657,
