class Solution {
    /**
    Change numerical base of input number x to base.
    return string representation after the conversion.
    base numbers are less than 10.
    >>> change_base(8, 3)
    "22"
    >>> change_base(8, 2)
    "1000"
    >>> change_base(7, 2)
    "111"
     */
    public String change_base(int x, int base) {
        // Input Validation
        if (base < 2 || base > 9) {
            throw new IllegalArgumentException("Base must be between 2 and 9.");
        }
        if (x < 0) {
            throw new IllegalArgumentException("Number must be non-negative.");
        }

        // Conversion Algorithm
        List<Integer> digits = new ArrayList<>();
        while (x > 0) {
            digits.add(x % base);
            x /= base;
        }
        Collections.reverse(digits);

        // Result Formatting
        StringBuilder result = new StringBuilder();
        for (int digit : digits) {
            result.append(digit);
        }

        return result.toString();
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.change_base(8, 3), "22"),
                Objects.equals(s.change_base(9, 3), "100"),
                Objects.equals(s.change_base(234, 2), "11101010"),
                Objects.equals(s.change_base(16, 2), "10000"),
                Objects.equals(s.change_base(8, 2), "1000"),
                Objects.equals(s.change_base(7, 2), "111")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
        for (int x = 2; x < 8; x++) {
            if (!Objects.equals(s.change_base(x, x + 1), String.valueOf(x))) {
                throw new AssertionError();
            }
        }
