class Solution {
    /**
    triples_sum_to_zero takes a list of integers as an input.
    it returns True if there are three distinct elements in the list that
    sum to zero, and False otherwise.

    >>> triples_sum_to_zero(Arrays.asList(1, 3, 5, 0))
    false
    >>> triples_sum_to_zero(Arrays.asList(1, 3, -2, 1))
    true
    >>> triples_sum_to_zero(Arrays.asList(1, 2, 3, 7))
    false
    >>> triples_sum_to_zero(Arrays.asList(2, 4, -5, 3, 9, 7))
    true
    >>> triples_sum_to_zero(Arrays.asList(1))
    false
     */
    public boolean triples_sum_to_zero(List<Integer> l) {
        // Step 1: Input Validation
        if (l == null || l.size() < 3) {
            return false;
        }

        // Step 2: Sort the List
        Collections.sort(l);

        // Step 3: Find Triplets
        for (int i = 0; i < l.size() - 2; i++) {
            // Skip duplicate elements
            if (i > 0 && l.get(i).equals(l.get(i - 1))) {
                continue;
            }

            int left = i + 1;
            int right = l.size() - 1;

            while (left < right) {
                int sum = l.get(i) + l.get(left) + l.get(right);

                if (sum == 0) {
                    return true;
                } else if (sum < 0) {
                    left++;
                } else {
                    right--;
                }
            }
        }

        // Step 4: Return Result
        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, 5, 0))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, 5, -1))),
                s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, -2, 1))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 2, 3, 7))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 2, 5, 7))),
                s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(2, 4, -5, 3, 9, 7))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, 5, -100))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(100, 3, 5, -100)))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
