     */
    public boolean pairs_sum_to_zero(List<Integer> l) {
        // Handle edge cases
        if (l == null || l.size() < 2) {
            return false;
        }

        // Initialize a set to keep track of seen elements
        Set<Integer> seen = new HashSet<>();

        // Iterate through the list
        for (int num : l) {
            if (seen.contains(-num)) {
                return true;
            }
            seen.add(num);
        }

        // Return false if no pairs sum to zero
        return false;
    }
}

