class Solution {
    /**
    Checks if given string is a palindrome
    >>> is_palindrome("")
    true
    >>> is_palindrome("aba")
    true
    >>> is_palindrome("aaaaa")
    true
    >>> is_palindrome("zbcd")
    false
     */
    public boolean is_palindrome(String text) {
        if (text == null) {
            throw new IllegalArgumentException("Input string cannot be null");
        }
        if (text.isEmpty()) {
            return true;
        }

        String normalizedText = text.toLowerCase();

        int left = 0;
        int right = normalizedText.length() - 1;

        while (left < right) {
            if (normalizedText.charAt(left) != normalizedText.charAt(right)) {
                return false;
            }
            left++;
            right--;
        }

        return true;
    }
}

