class Solution {
    /**
    Return True if list elements are monotonically increasing or decreasing.
    >>> monotonic(Arrays.asList(1, 2, 4, 20))
    true
    >>> monotonic(Arrays.asList(1, 20, 4, 10))
    false
    >>> monotonic(Arrays.asList(4, 1, 0, -10))
    true
     */
    public boolean monotonic(List<Integer> l) {
        if (l == null || l.size() < 2) {
            return true; // A list with less than 2 elements is trivially monotonic
        }

        boolean isIncreasing = true;
        boolean isDecreasing = true;

        for (int i = 1; i < l.size(); i++) {
            if (l.get(i) < l.get(i - 1)) {
                isIncreasing = false;
            }
            if (l.get(i) > l.get(i - 1)) {
                isDecreasing = false;
            }
        }

        return isIncreasing || isDecreasing;
    }
}

