class Solution {
    /**
    sum_to_n is a function that sums numbers from 1 to n.
    >>> sum_to_n(30)
    465
    >>> sum_to_n(100)
    5050
    >>> sum_to_n(5)
    15
    >>> sum_to_n(10)
    55
    >>> sum_to_n(1)
    1
     */
    public int sum_to_n(int n) {
        if (n < 1) {
            throw new IllegalArgumentException("n must be at least 1");
        }
        long result = ((long) n * (n + 1)) / 2;
        if (result > Integer.MAX_VALUE) {
            throw new ArithmeticException("Result exceeds the maximum value for int");
        }
        return (int) result;
    }
}

