class Solution {
    /**
    Circular shift the digits of the integer x, shift the digits right by shift
    and return the result as a string.
    If shift > number of digits, return digits reversed.
    >>> circular_shift(12, 1)
    "21"
    >>> circular_shift(12, 2)
    "12"
     */
    public String circular_shift(int x, int shift) {
        // Step 1: Convert x to a string
        String xStr = Integer.toString(x);

        // Step 2: Count the number of digits
        int numDigits = xStr.length();

        // Step 3: Check if shift is greater than the number of digits
        if (shift > numDigits) {
            // Reverse the string and return
            return new StringBuilder(xStr).reverse().toString();
        }

        // Step 4: Calculate the effective shift
        int effectiveShift = shift % numDigits;

        // Step 5: Perform the circular shift
        String lastPart = xStr.substring(numDigits - effectiveShift);
        String firstPart = xStr.substring(0, numDigits - effectiveShift);
        String result = lastPart + firstPart;

        // Step 6: Return the result
        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.circular_shift(100, 2).equals("001"),
                s.circular_shift(12, 2).equals("12"),
                s.circular_shift(97, 8).equals("79"),
                s.circular_shift(12, 1).equals("21"),
                s.circular_shift(11, 101).equals("11")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

