    the triangle rounded to 2 decimal points if the three sides form a valid triangle.
    Otherwise return -1
    Three sides make a valid triangle when the sum of any two sides is greater
    than the third side.
    Example:
    triangle_area(3, 4, 5) == 6.00
    triangle_area(1, 2, 10) == -1
     */
    public double triangle_area(double a, double b, double c) {
        if (isValidTriangle(a, b, c)) {
            double area = calculateArea(a, b, c);
            return Math.round(area * 100.0) / 100.0; // Round to 2 decimal points
        } else {
            return -1;
        }
    }

    private boolean isValidTriangle(double a, double b, double c) {
        return a > 0 && b > 0 && c > 0 && (a + b > c) && (a + c > b) && (b + c > a);
    }

    private double calculateArea(double a, double b, double c) {
        double s = (a + b + c) / 2;
        return Math.sqrt(s * (s - a) * (s - b) * (s - c));
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.triangle_area(3, 4, 5) == 6.00,
                s.triangle_area(1, 2, 10) == -1,
                s.triangle_area(4, 8, 5) == 8.18,
                s.triangle_area(2, 2, 2) == 1.73,
