class Solution {
    /**
    Write a function that returns True if the object q will fly, and False otherwise.
    The object q will fly if it's balanced (it is a palindromic list) and the sum of its elements is less than or equal the maximum possible weight w.

    Example:
    will_it_fly(Arrays.asList(1, 2), 5) -> false
    # 1+2 is less than the maximum possible weight, but it's unbalanced.

    will_it_fly(Arrays.asList(3, 2, 3), 1) -> false
    # it's balanced, but 3+2+3 is more than the maximum possible weight.

    will_it_fly(Arrays.asList(3, 2, 3), 9) -> true
    # 3+2+3 is less than the maximum possible weight, and it's balanced.

    will_it_fly(Arrays.asList(3), 5) -> true
    # 3 is less than the maximum possible weight, and it's balanced.
     */
    public boolean will_it_fly(List<Integer> q, int w) {
        if (!isPalindromic(q)) {
            return false;
        }
        int sum = calculateSum(q);
        return sum <= w;
    }

    private boolean isPalindromic(List<Integer> q) {
        int left = 0;
        int right = q.size() - 1;
        while (left < right) {
            if (!q.get(left).equals(q.get(right))) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }

    private int calculateSum(List<Integer> q) {
        int sum = 0;
        for (int num : q) {
            sum += num;
        }
        return sum;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.will_it_fly(new ArrayList<>(Arrays.asList(3, 2, 3)), 9),
                !s.will_it_fly(new ArrayList<>(Arrays.asList(1, 2)), 5),
                s.will_it_fly(new ArrayList<>(List.of(3)), 5),
                !s.will_it_fly(new ArrayList<>(Arrays.asList(3, 2, 3)), 1),
                !s.will_it_fly(new ArrayList<>(Arrays.asList(1, 2, 3)), 6),
                s.will_it_fly(new ArrayList<>(List.of(5)), 5)
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

