class Solution {
    /**
    Given list of integers, return list in strange order.
    Strange sorting, is when you start with the minimum value,
    then maximum of the remaining integers, then minimum and so on.

    Examples:
    strange_sort_list(Arrays.asList(1, 2, 3, 4)) == Arrays.asList(1, 4, 2, 3)
    strange_sort_list(Arrays.asList(5, 5, 5, 5)) == Arrays.asList(5, 5, 5, 5)
    strange_sort_list(Arrays.asList()) == Arrays.asList()
     */
    public List<Integer> strange_sort_list(List<Integer> lst) {
        // Step 1: Input Validation
        if (lst.isEmpty()) {
            return new ArrayList<>();
        }

        // Step 2: Handle Lists with Identical Elements
        boolean allIdentical = true;
        int firstElement = lst.get(0);
        for (int num : lst) {
            if (num != firstElement) {
                allIdentical = false;
                break;
            }
        }
        if (allIdentical) {
            return lst;
        }

        // Step 3: Sorting
        List<Integer> sortedList = new ArrayList<>(lst);
        Collections.sort(sortedList);

        // Step 4: Constructing the Strange Order List
        List<Integer> result = new ArrayList<>();
        while (!sortedList.isEmpty()) {
            // Add the minimum value
            result.add(sortedList.remove(0));
            // If the list is not empty, add the maximum value
            if (!sortedList.isEmpty()) {
                result.add(sortedList.remove(sortedList.size() - 1));
            }
        }

        // Step 5: Return the Result
        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.strange_sort_list(new ArrayList<>(Arrays.asList(1, 2, 3, 4))).equals(Arrays.asList(1, 4, 2, 3)),
                s.strange_sort_list(new ArrayList<>(Arrays.asList(5, 6, 7, 8, 9))).equals(Arrays.asList(5, 9, 6, 8, 7)),
