class Solution {
    // Method to generate all prime numbers less than 100
    private List<Integer> generatePrimes() {
        List<Integer> primes = new ArrayList<>();
        boolean[] isPrime = new boolean[100];
        Arrays.fill(isPrime, true);
        isPrime[0] = false; // 0 is not a prime number
        isPrime[1] = false; // 1 is not a prime number

        for (int i = 2; i < 100; i++) {
            if (isPrime[i]) {
                primes.add(i);
                for (int j = i * i; j < 100; j += i) {
                    isPrime[j] = false;
                }
            }
        }
        return primes;
    }

    // Method to check if the given number is the product of exactly 3 prime numbers
    public boolean is_multiply_prime(int a) {
        List<Integer> primes = generatePrimes();
        int n = primes.size();

        for (int i = 0; i < n; i++) {
            for (int j = i; j < n; j++) {
                for (int k = j; k < n; k++) {
                    if (primes.get(i) * primes.get(j) * primes.get(k) == a) {
                        return true;
                    }
                }
            }
        }
        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.is_multiply_prime(5),
