class Solution {
    /**
    It is the last week of the semester and the teacher has to give the grades
    to students. The teacher has been making her own algorithm for grading.
    The only problem is, she has lost the code she used for grading.
    She has given you a list of GPAs for some students and you have to write
    a function that can output a list of letter grades using the following table:
             GPA       |    Letter grade
              4.0                A+
            > 3.7                A
            > 3.3                A-
            > 3.0                B+
            > 2.7                B
            > 2.3                B-
            > 2.0                C+
            > 1.7                C
            > 1.3                C-
            > 1.0                D+
            > 0.7                D
            > 0.0                D-
              0.0                E


    Example:
    numerical_letter_grade(Arrays.asList(4.0, 3, 1.7, 2, 3.5)) ==> ["A+", "B", "C-", "C", "A-"]
     */
    public List<String> numerical_letter_grade(List<Double> grades) {
        if (grades == null || grades.isEmpty()) {
            return Collections.emptyList();
        }

        for (Double gpa : grades) {
            if (gpa < 0.0 || gpa > 4.0) {
                throw new IllegalArgumentException("Invalid GPA: " + gpa);
            }
        }

        List<String> letterGrades = new ArrayList<>();
        for (Double gpa : grades) {
            String letterGrade = getLetterGrade(gpa);
            letterGrades.add(letterGrade);
        }

        return letterGrades;
    }

    private String getLetterGrade(double gpa) {
        if (gpa == 4.0) return "A+";
        else if (gpa > 3.7) return "A";
        else if (gpa > 3.3) return "A-";
        else if (gpa > 3.0) return "B+";
        else if (gpa > 2.7) return "B";
        else if (gpa > 2.3) return "B-";
        else if (gpa > 2.0) return "C+";
        else if (gpa > 1.7) return "C";
        else if (gpa > 1.3) return "C-";
        else if (gpa > 1.0) return "D+";
        else if (gpa > 0.7) return "D";
        else if (gpa > 0.0) return "D-";
        else return "E";
    }
}

