class Solution {
    /**
    Write a function that takes a string and returns true if the string
    length is a prime number or false otherwise
    Examples
    prime_length("Hello") == true
    prime_length("abcdcba") == true
    prime_length("kittens") == true
    prime_length("orange") == false
     */

    // Step 1: Calculate the length of the string
    private int getLength(String string) {
        return string.length();
    }

    // Step 2: Check if a number is prime
    private boolean isPrime(int number) {
        if (number <= 1) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(number); i++) {
            if (number % i == 0) {
                return false;
            }
        }
        return true;
    }

    // Step 3: Combine the methods in the main function
    public boolean prime_length(String string) {
        int length = getLength(string);
        return isPrime(length);
    }
}

