class Solution {
    /**
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
     */
    public int starts_one_ends(int n) {
        if (n <= 0) {
            throw new IllegalArgumentException("n must be a positive integer");
        }

        // Count of n-digit numbers starting with 1
        int countStartsWithOne = (int) Math.pow(10, n - 1);

        // Count of n-digit numbers ending with 1
        int countEndsWithOne = (n == 1) ? 1 : 9 * (int) Math.pow(10, n - 2);

        // Count of n-digit numbers starting and ending with 1
        int countStartsAndEndsWithOne = (n == 1) ? 1 : (int) Math.pow(10, n - 2);

        // Combine the counts
        int totalCount = countStartsWithOne + countEndsWithOne - countStartsAndEndsWithOne;

        return totalCount;
    }
}

