class Solution {
    /**
    Create a function that takes 3 numbers.
    Returns true if one of the numbers is equal to the sum of the other two, and all numbers are integers.
    Returns false in any other cases.

    Examples
    any_int(5, 2, 7) -> true

    any_int(3, 2, 2) -> false

    any_int(3, -2, 1) -> true

    any_int(3.6, -2.2, 2) -> false
     */
    public boolean any_int(Object x, Object y, Object z) {
        double num1 = ((Number) x).doubleValue();
        double num2 = ((Number) y).doubleValue();
        double num3 = ((Number) z).doubleValue();

        if (!isInt(num1) || !isInt(num2) || !isInt(num3)) {
            return false;
        }

        if (num1 + num2 == num3 || num1 + num3 == num2 || num2 + num3 == num1) {
            return true;
        }

        return false;
    }

    private boolean isInt(double num) {
        return num == Math.floor(num) && !Double.isInfinite(num);
    }
}

