class Solution {
    /**
    You are given a 2 dimensional data, as a nested lists,
    which is similar to matrix, however, unlike matrices,
    each row may contain a different number of columns.
    Given lst, and integer x, find integers x in the list,
    and return list of lists, [[x1, y1], [x2, y2] ...] such that
    each list is a coordinate - (row, columns), starting with 0.
    Sort coordinates initially by rows in ascending order.
    Also, sort coordinates of the row by columns in descending order.

    Examples:
    get_row([
      [1,2,3,4,5,6],
      [1,2,3,4,1,6],
      [1,2,3,4,5,1]
    ], 1) == [[0, 0], [1, 4], [1, 0], [2, 5], [2, 0]]
    get_row([], 1) == []
    get_row([[], [1], [1, 2, 3]], 3) == [[2, 2]]
     */
    public List<List<Integer>> get_row(List<List<Integer>> lst, int x) {
        List<List<Integer>> coordinates = new ArrayList<>();

        // Traverse the 2D list to find all occurrences of x
        for (int row = 0; row < lst.size(); row++) {
            for (int col = 0; col < lst.get(row).size(); col++) {
                if (lst.get(row).get(col) == x) {
                    coordinates.add(Arrays.asList(row, col));
                }
            }
        }

        // Sort the coordinates
        Collections.sort(coordinates, new Comparator<List<Integer>>() {
            @Override
            public int compare(List<Integer> o1, List<Integer> o2) {
                int rowCompare = o1.get(0).compareTo(o2.get(0));
                if (rowCompare == 0) {
                    return o2.get(1).compareTo(o1.get(1)); // Descending order for columns
                }
                return rowCompare; // Ascending order for rows
            }
        });

        return coordinates;
    }
}

