class Solution {
    /**
    You are given a list of integers.
    Write a function next_smallest() that returns the 2nd smallest element of the list.
    Return null if there is no such element.
    <p>
    next_smallest(Arrays.asList(1, 2, 3, 4, 5)) == Optional[2]
    next_smallest(Arrays.asList(5, 1, 4, 3, 2)) == Optional[2]
    next_smallest(Arrays.asList()) == Optional.empty
    next_smallest(Arrays.asList(1, 1)) == Optional.empty
     */
    public Optional<Integer> next_smallest(List<Integer> lst) {
        // Input Validation
        if (lst.isEmpty()) {
            return Optional.empty();
        }

        Set<Integer> uniqueElements = new HashSet<>(lst);
        if (uniqueElements.size() < 2) {
            return Optional.empty();
        }

        // Finding the Second Smallest Element
        int firstSmallest = Integer.MAX_VALUE;
        int secondSmallest = Integer.MAX_VALUE;

        for (int num : lst) {
            if (num < firstSmallest) {
                secondSmallest = firstSmallest;
                firstSmallest = num;
            } else if (num < secondSmallest && num != firstSmallest) {
                secondSmallest = num;
            }
        }

        // Return the Result
        if (secondSmallest == Integer.MAX_VALUE) {
            return Optional.empty();
        } else {
            return Optional.of(secondSmallest);
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.next_smallest(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5))).get() == 2,
                s.next_smallest(new ArrayList<>(Arrays.asList(5, 1, 4, 3, 2))).get() == 2,
