class Solution {
    /**
    Given a map, return True if all keys are strings and all keys are in lower case or in upper case, else return False.
    The function should return False if the given map is empty.
    Examples:
    check_dict_case({"a":"apple", "b":"banana"}) should return True.
    check_dict_case({"a":"apple", "A":"banana", "B":"banana"}) should return False.
    check_dict_case({"a":"apple", 8:"banana", "a":"apple"}) should return False.
    check_dict_case({"Name":"John", "Age":"36", "City":"Houston"}) should return False.
    check_dict_case({"STATE":"NC", "ZIP":"12345" }) should return True.
     */
    public boolean check_dict_case(Map<Object, Object> dict) {
        // Step 1: Initialize variables
        boolean allLowerCase = true;
        boolean allUpperCase = true;

        // Step 2: Check if the map is empty
        if (dict.isEmpty()) {
            return false;
        }

        // Step 3: Iterate through the map
        for (Object key : dict.keySet()) {
            // Check if the key is a string
            if (!(key instanceof String)) {
                return false;
            }

            String strKey = (String) key;

            // Check if the key is in lowercase
            if (!strKey.equals(strKey.toLowerCase())) {
                allLowerCase = false;
            }

            // Check if the key is in uppercase
            if (!strKey.equals(strKey.toUpperCase())) {
                allUpperCase = false;
            }
        }

        // Step 4: Determine the final result
        return allLowerCase || allUpperCase;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.check_dict_case(new HashMap<>(Map.of("a", "apple", "b", "banana")))); // True
        System.out.println(solution.check_dict_case(new HashMap<>(Map.of("a", "apple", "A", "banana", "B", "banana")))); // False
        System.out.println(solution.check_dict_case(new HashMap<>(Map.of("a", "apple", 8, "banana", "a", "apple")))); // False
        System.out.println(solution.check_dict_case(new HashMap<>(Map.of("Name", "John", "Age", "36", "City", "Houston")))); // False
        System.out.println(solution.check_dict_case(new HashMap<>(Map.of("STATE", "NC", "ZIP", "12345")))); // True
    }
}

