class Solution {
    /**
    Create a function that takes a value (string) representing a number
    and returns the closest integer to it. If the number is equidistant
    from two integers, round it away from zero.

    Examples
    >>> closest_integer("10")
    10
    >>> closest_integer("15.3")
    15

    Note:
    Rounding away from zero means that if the given number is equidistant
    from two integers, the one you should return is the one that is the
    farthest from zero. For example closest_integer("14.5") should
    return 15 and closest_integer("-14.5") should return -15.
     */
    public int closest_integer(String value) {
        try {
            double number = Double.parseDouble(value);
            double floorValue = Math.floor(number);
            double ceilValue = Math.ceil(number);
            double fractionalPart = number - floorValue;

            if (fractionalPart == 0.5 || fractionalPart == -0.5) {
                // Round away from zero
                return (number > 0) ? (int) ceilValue : (int) floorValue;
            } else {
                // Round to the nearest integer
                return (int) Math.round(number);
            }
        } catch (NumberFormatException e) {
            throw new IllegalArgumentException("Invalid input: " + value);
        }
    }
}

