class Solution {
    /**
    You are given two positive integers n and m, and your task is to compute the
    average of the integers from n through m (including n and m).
    Round the answer to the nearest integer and convert that to binary.
    If n is greater than m, return -1.
    Example:
    rounded_avg(1, 5) => "11"
    rounded_avg(7, 5) => -1
    rounded_avg(10, 20) => "1111"
    rounded_avg(20, 33) => "11011"
     */
    public Object rounded_avg(int n, int m) {
        // Step 1: Input Validation
        if (n > m) {
            return -1;
        }

        // Step 2: Sum and Count Calculation
        int sum = 0;
        int count = 0;
        for (int i = n; i <= m; i++) {
            sum += i;
            count++;
        }

        // Step 3: Average Calculation
        double average = (double) sum / count;

        // Step 4: Rounding
        int roundedAverage = (int) Math.round(average);

        // Step 5: Binary Conversion
        String binaryRepresentation = Integer.toBinaryString(roundedAverage);

        // Step 6: Return the Result
        return binaryRepresentation;
    }
}

