class Solution {
    /**
    Given a list of positive integers x. return a sorted list of all
    elements that hasn't any even digit.

    Note: Returned list should be sorted in increasing order.

    For example:
    >>> unique_digits(Arrays.asList(15, 33, 1422, 1))
    [1, 15, 33]
    >>> unique_digits(Arrays.asList(152, 323, 1422, 10))
    []
     */
    public List<Integer> unique_digits(List<Integer> x) {
        if (x == null || x.isEmpty()) {
            return new ArrayList<>();
        }

        for (Integer num : x) {
            if (num <= 0) {
                throw new IllegalArgumentException("All elements must be positive integers.");
            }
        }

        List<Integer> filteredList = new ArrayList<>();
        for (Integer num : x) {
            if (!containsEvenDigit(num)) {
                filteredList.add(num);
            }
        }

        Collections.sort(filteredList);

        return filteredList;
    }

    private boolean containsEvenDigit(int num) {
        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) {
                return true;
            }
            num /= 10;
        }
        return false;
    }
}

