class Solution {
    /**
    Write a function count_nums which takes an array of integers and returns
    the number of elements which has a sum of digits > 0.
    If a number is negative, then its first signed digit will be negative:
    e.g. -123 has signed digits -1, 2, and 3.
    >>> count_nums(Arrays.asList()) == 0
    >>> count_nums(Arrays.asList(-1, 11, -11)) == 1
    >>> count_nums(Arrays.asList(1, 1, 2)) == 3
     */
    public int count_nums(List<Integer> arr) {
        int count = 0;
        for (int num : arr) {
            int sum = 0;
            String numStr = Integer.toString(num);
            boolean isNegative = num < 0;
            for (int i = 0; i < numStr.length(); i++) {
                char c = numStr.charAt(i);
                if (isNegative && i == 0) {
                    sum += Character.getNumericValue(c) * -1;
                } else {
                    sum += Character.getNumericValue(c);
                }
            }
            if (sum > 0) {
                count++;
            }
        }
        return count;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.count_nums(Arrays.asList())); // Output: 0
        System.out.println(solution.count_nums(Arrays.asList(-1, 11, -11))); // Output: 1
        System.out.println(solution.count_nums(Arrays.asList(1, 1, 2))); // Output: 3
    }
}

