class Solution {
    /**
    Given an array of integers nums, find the minimum sum of any non-empty sub-array
    of nums.
    Example
    minSubArraySum(Arrays.asList(2, 3, 4, 1, 2, 4)) == 1
    minSubArraySum(Arrays.asList(-1, -2, -3)) == -6
     */
    public int minSubArraySum(List<Integer> nums) {
        // Input validation
        if (nums == null || nums.isEmpty()) {
            throw new IllegalArgumentException("Input list cannot be null or empty");
        }

        // Initialization
        int currentMinSum = Integer.MAX_VALUE;
        int currentSum = 0;

        // Iterate through the array
        for (int num : nums) {
            currentSum += num;
            if (currentSum < currentMinSum) {
                currentMinSum = currentSum;
            }
            if (currentSum > 0) {
                currentSum = 0;
            }
        }

        // Return the result
        return currentMinSum;
    }
}

