class Solution {
    /**
    Task
    We are given two strings s and c, you have to delete all the characters in s that are equal to any character in c
    then check if the result string is palindrome.
    A string is called palindrome if it reads the same backward as forward.
    You should return a tuple containing the result string and true/false for the check.
    Example
    For s = "abcde", c = "ae", the result should be ("bcd",false)
    For s = "abcdef", c = "b"  the result should be ("acdef",false)
    For s = "abcdedcba", c = "ab", the result should be ("cdedc",true)
     */
    public List<Object> reverse_delete(String s, String c) {
        // Step 1: Initialize Variables
        Set<Character> charSet = new HashSet<>();
        for (char ch : c.toCharArray()) {
            charSet.add(ch);
        }
        StringBuilder resultBuilder = new StringBuilder();

        // Step 2: Remove Characters
        for (char ch : s.toCharArray()) {
            if (!charSet.contains(ch)) {
                resultBuilder.append(ch);
            }
        }
        String resultString = resultBuilder.toString();

        // Step 3: Palindrome Check
        boolean isPalindrome = true;
        for (int i = 0; i < resultString.length() / 2; i++) {
            if (resultString.charAt(i) != resultString.charAt(resultString.length() - 1 - i)) {
                isPalindrome = false;
                break;
            }
        }

        // Step 4: Construct Result
        List<Object> result = new ArrayList<>();
        result.add(resultString);
        result.add(isPalindrome);
        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.reverse_delete("abcde", "ae" ).equals(Arrays.asList("bcd", false)),
                s.reverse_delete("abcdef", "b" ).equals(Arrays.asList("acdef", false)),
                s.reverse_delete("abcdedcba", "ab" ).equals(Arrays.asList("cdedc", true)),
                s.reverse_delete("dwik", "w" ).equals(Arrays.asList("dik", false)),
                s.reverse_delete("a", "a" ).equals(Arrays.asList("", true)),
                s.reverse_delete("abcdedcba", "" ).equals(Arrays.asList("abcdedcba", true)),
                s.reverse_delete("abcdedcba", "v" ).equals(Arrays.asList("abcdedcba", true)),
                s.reverse_delete("vabba", "v" ).equals(Arrays.asList("abba", true)),
                s.reverse_delete("mamma", "mia" ).equals(Arrays.asList("", true))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

