class Solution {
    /**
    You are given a word. Your task is to find the closest vowel that stands between
    two consonants from the right side of the word (case sensitive).

    Vowels in the beginning and ending doesn't count. Return empty string if you didn't
    find any vowel met the above condition.

    You may assume that the given string contains English letter only.

    Example:
    get_closest_vowel("yogurt") ==> "u"
    get_closest_vowel("FULL") ==> "U"
    get_closest_vowel("quick") ==> ""
    get_closest_vowel("ab") ==> ""
     */
    public String get_closest_vowel(String word) {
        // Define the set of vowels
        Set<Character> vowels = new HashSet<>(Arrays.asList('a', 'e', 'i', 'o', 'u', 'A', 'E', 'I', 'O', 'U'));

        // Initialize variables
        char lastConsonant = '\0';
        String result = "";

        // Traverse the word from right to left
        for (int i = word.length() - 1; i >= 0; i--) {
            char currentChar = word.charAt(i);

            // Skip the last character if it is a vowel
            if (i == word.length() - 1 && vowels.contains(currentChar)) {
                continue;
            }

            // Check if the current character is a vowel
            if (vowels.contains(currentChar)) {
                // Check if the last seen character was a consonant and the next character is also a consonant
                if (lastConsonant != '\0' && (i > 0 && !vowels.contains(word.charAt(i - 1)))) {
                    result = String.valueOf(currentChar);
                    break;
                }
            } else {
                // Update the last seen consonant
                lastConsonant = currentChar;
            }
        }

        // Return the result
        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
