class Solution {
    /**
    You have to write a function which validates a given date string and
    returns true if the date is valid otherwise false.
    The date is valid if all of the following rules are satisfied:
    1. The date string is not empty.
    2. The number of days is not less than 1 or higher than 31 days for months 1,3,5,7,8,10,12. And the number of days is not less than 1 or higher than 30 days for months 4,6,9,11. And, the number of days is not less than 1 or higher than 29 for the month 2.
    3. The months should not be less than 1 or higher than 12.
    4. The date should be in the format: mm-dd-yyyy

    for example:
    valid_date("03-11-2000") => true
    valid_date("15-01-2012") => false
    valid_date("04-0-2040") => false
    valid_date("06-04-2020") => true
    valid_date("06/04/2020") => false
     */
    public boolean valid_date(String date) {
        // Step 1: Check if the date string is not empty
        if (date == null || date.isEmpty()) {
            return false;
        }

        // Step 2: Validate the format using regular expression
        String regex = "^(0[1-9]|1[0-2])-(0[1-9]|[12][0-9]|3[01])-(\\d{4})$";
        if (!Pattern.matches(regex, date)) {
            return false;
        }

        // Step 3: Split the date string to extract month, day, and year
        String[] parts = date.split("-");
        int month = Integer.parseInt(parts[0]);
        int day = Integer.parseInt(parts[1]);
        int year = Integer.parseInt(parts[2]);

        // Step 4: Validate the month
        if (month < 1 || month > 12) {
            return false;
        }

        // Step 5: Validate the day based on the month
        switch (month) {
            case 1:
            case 3:
            case 5:
            case 7:
            case 8:
            case 10:
            case 12:
                if (day < 1 || day > 31) {
                    return false;
                }
                break;
            case 4:
            case 6:
            case 9:
            case 11:
                if (day < 1 || day > 30) {
                    return false;
                }
                break;
            case 2:
                if (day < 1 || day > 29) {
                    return false;
                }
                break;
        }

        // Step 6: All validations passed
        return true;
    }
}

