class Solution {
    /**
    Given a string of words, return a list of words split on whitespace, if no whitespaces exists in the text you
    should split on commas ',' if no commas exists you should return the number of lower-case letters with odd order in the
    alphabet, ord('a') = 0, ord('b') = 1, ... ord('z') = 25
    Examples
    split_words("Hello world!") == ["Hello", "world!"]
    split_words("Hello,world!") == ["Hello", "world!"]
    split_words("abcdef") == 3
     */
    public Object split_words(String txt) {
        // Step 1: Input Validation
        if (txt == null) {
            throw new IllegalArgumentException("Input must be a non-null string");
        }

        // Step 2: Check for Whitespace
        if (txt.contains(" ")) {
            return Arrays.asList(txt.split("\\s+"));
        }

        // Step 3: Check for Commas
        if (txt.contains(",")) {
            return Arrays.asList(txt.split(","));
        }

        // Step 4: Count Lowercase Letters with Odd Order
        int count = 0;
        for (char c : txt.toCharArray()) {
            if (Character.isLowerCase(c) && ((c - 'a') % 2 == 1)) {
                count++;
            }
        }

        return count;
    }
}

