class Solution {
    /**
    Given an array arr of integers and a positive integer k, return a sorted list
    of length k with the maximum k numbers in arr, in ascending order.

    Example 1:

        Input: arr = [-3, -4, 5], k = 3
        Output: [-4, -3, 5]

    Example 2:

        Input: arr = [4, -4, 4], k = 2
        Output: [4, 4]

    Example 3:

        Input: arr = [-3, 2, 1, 2, -1, -2, 1], k = 1
        Output: [2]

    Note:
        1. The length of the array will be in the range of [1, 1000].
        2. The elements in the array will be in the range of [-1000, 1000].
        3. 0 <= k <= len(arr)
     */
    public List<Integer> maximum(List<Integer> arr, int k) {
        // Step 1: Input Validation
        if (arr == null || arr.isEmpty()) {
            throw new IllegalArgumentException("Array must not be null or empty.");
        }
        if (k < 0 || k > arr.size()) {
            throw new IllegalArgumentException("k must be within the range [0, " + arr.size() + "].");
        }

        // Step 2: Extract the Maximum k Numbers
        PriorityQueue<Integer> maxHeap = new PriorityQueue<>(Collections.reverseOrder());
        maxHeap.addAll(arr);
        List<Integer> topK = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            topK.add(maxHeap.poll());
        }

        // Step 3: Sort the Extracted Numbers
        Collections.sort(topK);

        // Step 4: Return the Result
        return topK;
    }
}

