class Solution {
    /**
    Given a list of numbers, return whether or not they are sorted
    in ascending order. If the a number appears more than twice, return false. Assume no negative numbers and only integers.

    Examples
    is_sorted(Arrays.asList(5)) -> true
    is_sorted(Arrays.asList(1, 2, 3, 4, 5)) -> true
    is_sorted(Arrays.asList(1, 3, 2, 4, 5)) -> false
    is_sorted(Arrays.asList(1, 2, 3, 4, 5, 6)) -> true
    is_sorted(Arrays.asList(1, 2, 3, 4, 5, 6, 7)) -> true
    is_sorted(Arrays.asList(1, 3, 2, 4, 5, 6, 7)) -> false
    is_sorted(Arrays.asList(1, 2, 2, 3, 3, 4)) -> true
    is_sorted(Arrays.asList(1, 2, 2, 2, 3, 4)) -> false
     */
    public boolean is_sorted(List<Integer> lst) {
        // Handle edge cases
        if (lst.isEmpty() || lst.size() == 1) {
            return true;
        }

        // Initialize variables
        Map<Integer, Integer> frequencyMap = new HashMap<>();
        int previousNumber = -1;

        // Iterate through the list
        for (int currentNumber : lst) {
            // Update frequency map
            frequencyMap.put(currentNumber, frequencyMap.getOrDefault(currentNumber, 0) + 1);

            // Check if the current number appears more than twice
            if (frequencyMap.get(currentNumber) > 2) {
                return false;
            }

            // Check if the list is sorted in ascending order
            if (previousNumber != -1 && currentNumber < previousNumber) {
                return false;
            }

            // Update previous number
            previousNumber = currentNumber;
        }

        // Return true if all conditions are met
        return true;
    }
}

