class Solution {
    /**
    You are given two intervals,
    where each interval is a pair of integers. For example, interval = (start, end) = (1, 2).
    The given intervals are closed which means that the interval (start, end)
    includes both start and end.
    For each given interval, it is assumed that its start is less or equal its end.
    Your task is to determine whether the length of intersection of these two
    intervals is a prime number.
    Example, the intersection of the intervals (1, 3), (2, 4) is (2, 3)
    which its length is 1, which not a prime number.
    If the length of the intersection is a prime number, return "YES",
    otherwise, return "NO".
    If the two intervals don't intersect, return "NO".

    [input/output] samples:
    intersection((1, 2), (2, 3)) ==> "NO"
    intersection((-1, 1), (0, 4)) ==> "NO"
    intersection((-3, -1), (-5, 5)) ==> "YES"
     */
    public String intersection(List<Integer> interval1, List<Integer> interval2) {
        if (interval1 == null || interval2 == null || interval1.size() != 2 || interval2.size() != 2) {
            throw new IllegalArgumentException("Invalid intervals");
        }
        int start1 = interval1.get(0);
        int end1 = interval1.get(1);
        int start2 = interval2.get(0);
        int end2 = interval2.get(1);
        if (start1 > end1 || start2 > end2) {
            throw new IllegalArgumentException("Invalid intervals");
        }

        int maxStart = Math.max(start1, start2);
        int minEnd = Math.min(end1, end2);
        if (maxStart > minEnd) {
            return "NO";
        }

        int intersectionLength = minEnd - maxStart + 1;

        if (isPrime(intersectionLength)) {
            return "YES";
        } else {
            return "NO";
        }
    }

    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        if (n <= 3) {
            return true;
        }
        if (n % 2 == 0 || n % 3 == 0) {
            return false;
        }
        for (int i = 5; i * i <= n; i += 6) {
            if (n % i == 0 || n % (i + 2) == 0) {
                return false;
            }
        }
        return true;
    }
}

