class Solution {
    private List<List<Integer>> grid;
    private int N;
    private int[][] directions = {{0, 1}, {1, 0}, {0, -1}, {-1, 0}};

    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        this.grid = grid;
        N = grid.size();
        List<Integer> bestPath = new ArrayList<>();
        List<Integer> path = new ArrayList<>();

        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                path.add(grid.get(i).get(j));
                dfs(i, j, path, k, bestPath);
                path.clear();
            }
        }

        return bestPath;
    }

    private boolean is_valid_move(int x, int y) {
        return x >= 0 && x < N && y >= 0 && y < N;
    }

    private void dfs(int x, int y, List<Integer> path, int k, List<Integer> bestPath) {
        if (path.size() == k) {
            if (bestPath.isEmpty() || is_lexicographically_smaller(path, bestPath)) {
                bestPath.clear();
                bestPath.addAll(path);
            }
            return;
        }

        for (int[] dir : directions) {
            int newX = x + dir[0];
            int newY = y + dir[1];
            if (is_valid_move(newX, newY)) {
                path.add(grid.get(newX).get(newY));
                dfs(newX, newY, path, k, bestPath);
                path.remove(path.size() - 1);
            }
        }
    }

    private boolean is_lexicographically_smaller(List<Integer> path1, List<Integer> path2) {
        for (int i = 0; i < path1.size(); i++) {
            if (path1.get(i) < path2.get(i)) return true;
            if (path1.get(i) > path2.get(i)) return false;
        }
        return false;
    }
}

