class Solution {
    /**
    The Brazilian factorial is defined as:
    brazilian_factorial(n) = n! * (n-1)! * (n-2)! * ... * 1!
    where n > 0

    For example:
    >>> special_factorial(4)
    288

    The function will receive an integer as input and should return the special
    factorial of this integer.
     */
    public long special_factorial(int n) {
        if (n <= 0) {
            throw new IllegalArgumentException("Input must be a positive integer greater than 0");
        }

        long result = 1;
        for (int i = 1; i <= n; i++) {
            result *= factorial(i);
        }
        return result;
    }

    private long factorial(int k) {
        if (k == 0 || k == 1) {
            return 1;
        }
        long result = 1;
        for (int i = 2; i <= k; i++) {
            result *= i;
        }
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.special_factorial(1)); // Expected output: 1
        System.out.println(solution.special_factorial(2)); // Expected output: 2
        System.out.println(solution.special_factorial(3)); // Expected output: 12
        System.out.println(solution.special_factorial(4)); // Expected output: 288
        System.out.println(solution.special_factorial(5)); // Expected output: 34560

        // Edge case
        try {
            System.out.println(solution.special_factorial(0)); // Should throw an exception
        } catch (IllegalArgumentException e) {
            System.out.println(e.getMessage());
        }
    }
}

