class Solution {
    /**
    Create a function that returns a tuple (a, b), where 'a' is
    the largest of negative integers, and 'b' is the smallest
    of positive integers in a list.
    If there is no negative or positive integers, return them as None.

    Examples:
    largest_smallest_integers(Arrays.asList(2, 4, 1, 3, 5, 7)) == (Optional.empty(), Optional.of(1))
    largest_smallest_integers(Arrays.asList()) == (Optional.empty(), Optional.empty())
    largest_smallest_integers(Arrays.asList(0)) == (Optional.empty(), Optional.empty())
     */
    public List<Optional<Integer>> largest_smallest_integers(List<Integer> lst) {
        // Step 1: Initialize variables
        List<Integer> negativeIntegers = new ArrayList<>();
        List<Integer> positiveIntegers = new ArrayList<>();

        // Step 2: Filter the input list
        for (Integer num : lst) {
            if (num < 0) {
                negativeIntegers.add(num);
            } else if (num > 0) {
                positiveIntegers.add(num);
            }
        }

        // Step 3: Find the largest negative integer
        Optional<Integer> largestNegative = negativeIntegers.isEmpty() ? Optional.empty() : Optional.of(Collections.max(negativeIntegers));

        // Step 4: Find the smallest positive integer
        Optional<Integer> smallestPositive = positiveIntegers.isEmpty() ? Optional.empty() : Optional.of(Collections.min(positiveIntegers));

        // Step 5: Return the results
        return Arrays.asList(largestNegative, smallestPositive);
    }
}

