    and if a string has more than 2 consecutive spaces,
    then replace all consecutive spaces with -

    fix_spaces("Example") == "Example"
    fix_spaces("Example 1") == "Example_1"
    fix_spaces(" Example 2") == "_Example_2"
    fix_spaces(" Example   3") == "_Example-3"
     */
    public String fix_spaces(String text) {
        StringBuilder result = new StringBuilder();
        int consecutiveSpaces = 0;

        for (int i = 0; i < text.length(); i++) {
            char c = text.charAt(i);
            if (c == ' ') {
                consecutiveSpaces++;
            } else {
                if (consecutiveSpaces > 2) {
                    result.append('-');
                } else if (consecutiveSpaces > 0) {
                    for (int j = 0; j < consecutiveSpaces; j++) {
                        result.append('_');
                    }
                }
                consecutiveSpaces = 0;
                result.append(c);
            }
        }

        // Handle trailing spaces
        if (consecutiveSpaces > 2) {
            result.append('-');
        } else if (consecutiveSpaces > 0) {
            for (int j = 0; j < consecutiveSpaces; j++) {
                result.append('_');
            }
        }

        return result.toString();
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.fix_spaces("Example" ), "Example" ),
                Objects.equals(s.fix_spaces("Mudasir Hanif " ), "Mudasir_Hanif_" ),
                Objects.equals(s.fix_spaces("Yellow Yellow  Dirty  Fellow" ), "Yellow_Yellow__Dirty__Fellow" ),
                Objects.equals(s.fix_spaces("Exa   mple" ), "Exa-mple" ),
