class Solution {
    /**
    Write a function that takes an array of numbers as input and returns
    the number of elements in the array that are greater than 10 and both
    first and last digits of a number are odd (1, 3, 5, 7, 9).
    For example:
    specialFilter(Arrays.asList(15, -73, 14, -15)) => 1
    specialFilter(Arrays.asList(33, -2, -3, 45, 21, 109)) => 2
     */
    public int specialFilter(List<Integer> nums) {
        int count = 0;
        for (int num : nums) {
            if (isGreaterThanTen(num) && areBothDigitsOdd(getFirstDigit(num), getLastDigit(num))) {
                count++;
            }
        }
        return count;
    }

    private boolean isGreaterThanTen(int num) {
        return num > 10;
    }

    private int getFirstDigit(int num) {
        num = Math.abs(num); // Ensure the number is positive
        while (num >= 10) {
            num /= 10;
        }
        return num;
    }

    private int getLastDigit(int num) {
        return Math.abs(num) % 10; // Ensure the number is positive
    }

    private boolean areBothDigitsOdd(int firstDigit, int lastDigit) {
        return firstDigit % 2 != 0 && lastDigit % 2 != 0;
    }
}

