class NumberWithIndex {
    int num;
    int originalIndex;
    int digitSum;

    public NumberWithIndex(int num, int originalIndex, int digitSum) {
        this.num = num;
        this.originalIndex = originalIndex;
        this.digitSum = digitSum;
    }
}

class Solution {
    // Helper method to calculate the sum of digits
    private int digitSum(int num) {
        boolean isNegative = num < 0;
        num = Math.abs(num);
        int sum = 0;
        while (num > 0) {
            sum += num % 10;
            num /= 10;
        }
        if (isNegative) {
            sum = sum - 2 * (sum % 10); // Adjust the sum to account for the negative first digit
        }
        return sum;
    }

    // Main method to sort the list
    public List<Integer> order_by_points(List<Integer> nums) {
        List<NumberWithIndex> numberList = new ArrayList<>();

        // Create a list of NumberWithIndex objects
        for (int i = 0; i < nums.size(); i++) {
            int num = nums.get(i);
            int sum = digitSum(num);
            numberList.add(new NumberWithIndex(num, i, sum));
        }

        // Sort the list based on digit sum and original index
        Collections.sort(numberList, (a, b) -> {
            if (a.digitSum != b.digitSum) {
                return a.digitSum - b.digitSum;
            } else {
                return a.originalIndex - b.originalIndex;
            }
        });

        // Extract and return the sorted integers
        List<Integer> sortedNums = new ArrayList<>();
        for (NumberWithIndex nwi : numberList) {
            sortedNums.add(nwi.num);
        }

        return sortedNums;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
