class Solution {
    /**
    You are given a positive integer n. You have to create an integer array a of length n.
        For each i (1 <= i <= n), the value of a[i] = i * i - i + 1.
        Return the number of triples (a[i], a[j], a[k]) of a where i < j < k,
    and a[i] + a[j] + a[k] is a multiple of 3.

    Example :
        Input: n = 5
        Output: 1
        Explanation:
        a = [1, 3, 7, 13, 21]
        The only valid triple is (1, 7, 13).
     */
    public int get_max_triples(int n) {
        // Step 1: Initialize the array
        int[] a = new int[n];
        for (int i = 1; i <= n; i++) {
            a[i - 1] = i * i - i + 1;
        }

        // Step 2: Initialize the counter
        int count = 0;

        // Step 3: Iterate through all possible triples
        for (int i = 0; i < n - 2; i++) {
            for (int j = i + 1; j < n - 1; j++) {
                for (int k = j + 1; k < n; k++) {
                    // Step 4: Check if the sum is a multiple of 3
                    if ((a[i] + a[j] + a[k]) % 3 == 0) {
                        count++;
                    }
                }
            }
        }

        // Step 5: Return the result
        return count;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.get_max_triples(5) == 1,
                s.get_max_triples(6) == 4,
                s.get_max_triples(10) == 36,
                s.get_max_triples(100) == 53361
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

