class Solution {
    /**
    Given the lengths of the three sides of a triangle. Return true if the three
    sides form a right-angled triangle, false otherwise.
    A right-angled triangle is a triangle in which one angle is right angle or
    90 degree.
    Example:
    right_angle_triangle(3, 4, 5) == true
    right_angle_triangle(1, 2, 3) == false
     */
    public boolean right_angle_triangle(int a, int b, int c) {
        // Input validation
        if (a <= 0 || b <= 0 || c <= 0) {
            return false;
        }
        if (a + b <= c || a + c <= b || b + c <= a) {
            return false;
        }

        // Identify the hypotenuse
        int maxSide = Math.max(a, Math.max(b, c));
        int side1, side2;
        if (maxSide == a) {
            side1 = b;
            side2 = c;
        } else if (maxSide == b) {
            side1 = a;
            side2 = c;
        } else {
            side1 = a;
            side2 = b;
        }

        // Check the Pythagorean theorem
        int hypotenuseSquare = maxSide * maxSide;
        int otherSidesSquareSum = side1 * side1 + side2 * side2;

        return hypotenuseSquare == otherSidesSquareSum;
    }
}

