import javax.script.ScriptEngineManager;
import javax.script.ScriptEngine;
import javax.script.ScriptException;

class Solution {
    /**
    Given two lists operator, and operand. The first list has basic algebra operations, and
    the second list is a list of integers. Use the two given lists to build the algebraic
    expression and return the evaluation of this expression.

    The basic algebra operations:
    Addition ( + )
    Subtraction ( - )
    Multiplication ( * )
    Floor division ( / )
    Exponentiation ( ** )

    Example:
    operator["+", "*", "-"]
    array = [2, 3, 4, 5]
    result = 2 + 3 * 4 - 5
    => result = 9

    Note:
        The length of operator list is equal to the length of operand list minus one.
        Operand is a list of non-negative integers.
        Operator list has at least one operator, and operand list has at least two operands.
     */
    public int do_algebra(List<String> operator, List<Integer> operand) {
        if (!validateInputs(operator, operand)) {
            throw new IllegalArgumentException("Invalid input");
        }

        String expression = constructExpression(operator, operand);
        return evaluateExpression(expression);
    }

    private boolean validateInputs(List<String> operator, List<Integer> operand) {
        // Check lengths
        if (operator.size() != operand.size() - 1) {
            return false;
        }

        // Validate operators
        Set<String> validOperators = new HashSet<>(Arrays.asList("+", "-", "*", "/", "**"));
        for (String op : operator) {
            if (!validOperators.contains(op)) {
                return false;
            }
        }

        // Validate operands
        for (int num : operand) {
            if (num < 0) {
                return false;
            }
        }

        return true;
    }

    private String constructExpression(List<String> operator, List<Integer> operand) {
        StringBuilder expression = new StringBuilder();
        for (int i = 0; i < operand.size() - 1; i++) {
            expression.append(operand.get(i)).append(" ").append(operator.get(i)).append(" ");
        }
        expression.append(operand.get(operand.size() - 1));
        return expression.toString();
    }

    private int evaluateExpression(String expression) {
        // Use a scripting engine to evaluate the expression
        ScriptEngineManager manager = new ScriptEngineManager();
        ScriptEngine engine = manager.getEngineByName("JavaScript");
        try {
            return (int) engine.eval(expression);
        } catch (ScriptException e) {
            throw new RuntimeException("Error evaluating expression: " + expression, e);
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.do_algebra(new ArrayList<>(Arrays.asList("**", "*", "+")), new ArrayList<>(Arrays.asList(2, 3, 4, 5))) == 37,
                s.do_algebra(new ArrayList<>(Arrays.asList("+", "*", "-")), new ArrayList<>(Arrays.asList(2, 3, 4, 5))) == 9,
                s.do_algebra(new ArrayList<>(Arrays.asList("/", "*")), new ArrayList<>(Arrays.asList(7, 3, 4))) == 8,
                s.do_algebra(new ArrayList<>(Arrays.asList("+", "**", "**")), new ArrayList<>(Arrays.asList(7, 5, 3, 2))) == 1953132
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

import java.math.BigInteger;
import java.util.stream.Collectors;
import java.security.*;
import java.util.*;
import java.lang.*;
import java.security.MessageDigest;
import java.security.NoSuchAlgorithmException;
import java.util.Optional;

class Solution {
    /**
    Given a string "text", return its md5 hash equivalent string with length being 32.
    If "text" is an empty string, return Optional.empty().

    >>> string_to_md5("Hello world") == "3e25960a79dbc69b674cd4ec67a72c62"
     */
    public Optional<String> string_to_md5(String text) throws NoSuchAlgorithmException {
        if (text.isEmpty()) {
            return Optional.empty();
        }

        MessageDigest md = MessageDigest.getInstance("MD5");
        byte[] messageDigest = md.digest(text.getBytes());

        StringBuilder hexString = new StringBuilder();
        for (byte b : messageDigest) {
            String hex = Integer.toHexString(0xff & b);
            if (hex.length() == 1) {
                hexString.append('0');
            }
            hexString.append(hex);
        }

        return Optional.of(hexString.toString());
    }
}

public class Main {
    public static void main(String[] args) throws NoSuchAlgorithmException {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.string_to_md5("Hello world").get().equals("3e25960a79dbc69b674cd4ec67a72c62"),
                s.string_to_md5("").isEmpty(),
                s.string_to_md5("A B C").get().equals("0ef78513b0cb8cef12743f5aeb35f888"),
                s.string_to_md5("password").get().equals("5f4dcc3b5aa765d61d8327deb882cf99")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}
